import React, { Component } from 'react';
import {BrowserRouter, Route  , Routes} from 'react-router-dom' ;

import Login from './Login.js';
import Main from './Main.js';


function App (){
  return (
    <div className="App">
      <BrowserRouter>
      <Routes >
        <Route path='/' element = {<Login/>} />
        <Route path='/Main'  element = {<Main />} />

      </Routes>
      </BrowserRouter>
      
    </div>
  );


}

export default App;
